oxy_webhelp_navlinks = {"tocId-d22872e4115":{"topics":[{"title":"SLA Domains","shortdesc":"<p class=\"shortdesc\">SLA Domains in <span class=\"ph\">RSC<\/span> unify data protection policies, providing a         unified approach to manage data protection across various workloads and         environments.<\/p>","href":"saas\/sla_domains.html","attributes":{"data-id":"sla_domains"},"menu":{"hasChildren":true},"tocID":"sla_domains-d22872e4121","next":"sla_domains-d22872e4121"},{"title":"Archiving of data center workloads","shortdesc":"<p class=\"shortdesc\">With <span class=\"ph\">Rubrik Security Cloud<\/span>, you can create and manage archival locations to         archive the disaster recovery and long-term retention data of data center         workloads.<\/p>","href":"archival\/archiving_data_center_workloads.html","attributes":{"data-id":"archiving_data_center_workloads"},"menu":{"hasChildren":true},"tocID":"archiving_data_center_workloads-d22872e5173","next":"archiving_data_center_workloads-d22872e5173"},{"title":"Rubrik Cloud Vault","shortdesc":"<p class=\"shortdesc\">Rubrik Cloud Vault is a Rubrik managed cloud service that provides isolated and         immutable copies of protected data, enhancing cyber resiliency.<\/p>","href":"saas\/rcv_rubrik_cloud_vault.html","attributes":{"data-id":"rcv_rubrik_cloud_vault"},"menu":{"hasChildren":true},"tocID":"rcv_rubrik_cloud_vault-d22872e6595","next":"rcv_rubrik_cloud_vault-d22872e6595"},{"title":"Cascading archival","shortdesc":"<p class=\"shortdesc\">Using cascading archival, you can increase replicated data redundancy and decrease         data storage costs by archiving replicated snapshots from a replication target Rubrik         cluster to a remote archival location.<\/p>","href":"saas\/cascading_archival.html","attributes":{"data-id":"cascading_archival"},"menu":{"hasChildren":true},"tocID":"cascading_archival-d22872e7341","next":"cascading_archival-d22872e7341"},{"title":"Replication","shortdesc":"<p class=\"shortdesc\">The replication feature directs the Rubrik cluster to send replicas of source       snapshots or backups to a target Rubrik cluster and defines the maximum time to keep the       replica on each cluster.<\/p>","href":"replication\/replication.html","attributes":{"data-id":"replication"},"menu":{"hasChildren":true},"tocID":"replication-d22872e7396","next":"replication-d22872e7396"}]}};